import React, { Component } from "react";
import { Container, Row, Col } from "reactstrap";
import "../styles/Contact.scss";

class Contact extends Component {
  clickHandler = () => {};

  render() {
    return (
      <div id="Contact">
        <Container>
          <Row>
            <Col class="col">
              <div class="div div1"></div>
              {/* <img src={} /> */}
