            </Col>
            <Col class="col">
            <div class="div div3"></div>
              {/* <img src={} /> */}
              <h3>Asya</h3>
            </Col>
          </Row>
          <Row>
          <Col class="col">
            <div class="div div4"></div>
              {/* <img src={} /> */}
              <h3>Asya</h3>
            </Col>
            <Col class="col">
            <div class="div div5"></div>
              {/* <img src={} /> */}
              <h3>Asya</h3>
            </Col>
            <Col class="col">
            <div class="div div6"></div>
              {/* <img src={} /> */}
            </Col>
          </Row>
        </Container>
      </div>
    );
  }
}

export default Contact;
